import React from 'react';
import './Sidebar.css';

function Sidebar() {
  return (
    <div className="sidebar">
        <div></div>
      <div className="sidebar-item">Program Types</div>
      <div className="sidebar-item">Rules</div>
      <div className="sidebar-item">Validate Content</div>
    </div>
  );
}

export default Sidebar;
